function parseSkillFrontmatter(content) {
  const frontmatterMatch = content.match(/^---\n([\s\S]*?)\n---\n([\s\S]*)$/);
  if (!frontmatterMatch) {
    return { body: content };
  }
  const [, frontmatter, body] = frontmatterMatch;
  const result = { body };
  for (const line of frontmatter.split(`
`)) {
    const nameMatch = line.match(/^name:\s*(.+)$/);
    if (nameMatch)
      result.name = nameMatch[1].trim().replace(/^["']|["']$/g, "");
    const descMatch = line.match(/^description:\s*(.+)$/);
    if (descMatch)
      result.description = descMatch[1].trim().replace(/^["']|["']$/g, "");
  }
  return result;
}
function loadSkillsFromDir(skillsDir) {
  const skills = [];
  if (!fs3.existsSync(skillsDir))
    return skills;
  try {
    const entries = fs3.readdirSync(skillsDir, { withFileTypes: true });
    for (const entry of entries) {
      if (entry.isDirectory()) {
        const skillMdPath = path2.join(skillsDir, entry.name, "SKILL.md");
        if (fs3.existsSync(skillMdPath)) {
          const content = fs3.readFileSync(skillMdPath, "utf-8");
          const parsed = parseSkillFrontmatter(content);
          skills.push({
            name: parsed.name || entry.name,
            description: parsed.description || "",
            content,
            basePath: path2.join(skillsDir, entry.name)
          });
        }
      }
    }
  } catch (e) {
    console.error(`[Worker] Error loading skills from ${skillsDir}:`, e);
  }
  return skills;
}
function loadAllSkills(cwd2) {
  const projectSkillsDir = path2.join(cwd2, ".claude", "skills");
  const globalSkillsDir = path2.join(os2.homedir(), ".claude", "skills");
  const projectSkills = loadSkillsFromDir(projectSkillsDir);
  const globalSkills = loadSkillsFromDir(globalSkillsDir);
  const allSkills = [...projectSkills];
  for (const gs of globalSkills) {
    if (!allSkills.find((s) => s.name === gs.name)) {
      allSkills.push(gs);
    }
  }
  return allSkills;
}
