function formatMessage(msg, uiSessionId) {
  const timestamp = Date.now();
  const uuid5 = msg.uuid || crypto.randomUUID();
  switch (msg.type) {
    case "system": {
      const systemMsg = msg;
      const base = {
        type: "system",
        uiSessionId,
        claudeSessionId: msg.session_id,
        subtype: systemMsg.subtype,
        uuid: uuid5,
        timestamp
      };
      switch (systemMsg.subtype) {
        case "init":
          return {
            ...base,
            cwd: systemMsg.cwd,
            model: systemMsg.model,
            tools: systemMsg.tools,
            skills: systemMsg.skills,
            mcp_servers: systemMsg.mcp_servers,
            permissionMode: systemMsg.permissionMode,
            apiKeySource: systemMsg.apiKeySource,
            betas: systemMsg.betas,
            agents: systemMsg.agents
          };
        case "compact_boundary":
          return {
            ...base,
            compactMetadata: systemMsg.compact_metadata
          };
        case "status":
          return {
            ...base,
            status: systemMsg.status
          };
        case "hook_response":
          return {
            ...base,
            hookName: systemMsg.hook_name,
            hookEvent: systemMsg.hook_event,
            stdout: systemMsg.stdout,
            stderr: systemMsg.stderr,
            exitCode: systemMsg.exit_code
          };
        default:
          return base;
      }
    }
    case "assistant":
      return {
        type: "assistant",
        uiSessionId,
        claudeSessionId: msg.session_id,
        content: msg.message.content,
        parentToolUseId: msg.parent_tool_use_id || null,
        uuid: uuid5,
        timestamp,
        error: msg.error,
        usage: msg.message?.usage
      };
    case "user":
      return {
        type: "user",
        uiSessionId,
        content: msg.message.content,
        parentToolUseId: msg.parent_tool_use_id || null,
        uuid: uuid5,
        timestamp,
        isSynthetic: msg.isSynthetic,
        toolUseResult: msg.tool_use_result,
        isReplay: msg.isReplay
      };
    case "result": {
      const resultMsg = msg;
      return {
        type: "result",
        uiSessionId,
        claudeSessionId: msg.session_id,
        subtype: resultMsg.subtype,
        costUsd: resultMsg.total_cost_usd,
        durationMs: resultMsg.duration_ms,
        durationApiMs: resultMsg.duration_api_ms,
        numTurns: resultMsg.num_turns,
        usage: resultMsg.usage,
        modelUsage: resultMsg.modelUsage,
        isError: resultMsg.is_error,
        result: resultMsg.result,
        errors: resultMsg.errors,
        permissionDenials: resultMsg.permission_denials,
        structuredOutput: resultMsg.structured_output,
        uuid: uuid5,
        timestamp
      };
    }
    case "tool_progress":
      return {
        type: "tool_progress",
        uiSessionId,
        toolUseId: msg.tool_use_id,
        toolName: msg.tool_name,
        parentToolUseId: msg.parent_tool_use_id || null,
        elapsedTimeSeconds: msg.elapsed_time_seconds,
        uuid: uuid5,
        timestamp
      };
    case "stream_event": {
      const streamMsg = msg;
      return {
        type: "stream_event",
        uiSessionId,
        claudeSessionId: msg.session_id,
        event: streamMsg.event,
        parentToolUseId: streamMsg.parent_tool_use_id || null,
        uuid: uuid5,
        timestamp
      };
    }
    case "auth_status": {
      const authMsg = msg;
      return {
        type: "auth_status",
        uiSessionId,
        claudeSessionId: msg.session_id,
        isAuthenticating: authMsg.isAuthenticating,
        output: authMsg.output,
        error: authMsg.error,
        uuid: uuid5,
        timestamp
      };
    }
    default:
      return {
        type: "unknown",
        uiSessionId,
        raw: msg,
        uuid: uuid5,
        timestamp
      };
  }
}
